import React, { Component } from 'react';
import { Container, Col, } from 'react-bootstrap';
import Astro from '../astro2.jpg'
import './home.css'


export class Home extends Component {
      render() {
        return(
          <div id="image">
          <img src={Astro} alt="Stars in the sky" />
          <Container>
            <Col xs={12} sm={8} smOffset={2}>
              <h3>About Me...</h3>
            </Col>
          </Container>
          </div>

        )
      }
}
